import { configureStore, createSlice } from "@reduxjs/toolkit";

const initialState = { urlList: [] };

const urlTotalArray = createSlice({
  name: "urlTotalArray",
  initialState: {
    list: [
      {
        url: "",
        key: -1,
      },
    ],
  },
  reducers: {
    add(state, action) {
      state.list = [...state.list, ...action];
    },
  },
});

const urlTempArray = createSlice({
  name: "urlTempArray",
  initialState: {
    list: [
      {
        url: "",
        key: -1,
      },
    ],
  },
  reducers: {
    add(state, action) {
      state.list = [...action.payload];
    },
  },
});

const store = configureStore({
  reducer: { urlTotalArray: urlTotalArray.reducer },
});

export const urlTotalArrayActions = urlTotalArray.actions;

export default store;
